import React from 'react';

export default class AdminLogin extends React.Component{
    render(){
        return(
            <div style={decor.small}>
                <div>
                    <h2 style={decor.font}>Admin login</h2>
                </div>
                <div>
                    <input/>
                    <input/>
                </div>
            </div>
        )
    }
}
const decor={
    font:{
        paddingTop: '17em',
        fontFamily:"'EB Garamond', serif",
        borderBottom: '1px solid black',
        padding: '10px'
    },
    small:{
        width:'70%'
    },
    input:{
        width:'360px',
        display: 'inline-block',
        float: 'left',
        padding: '6px 30px 6px 6px',
        backgroundPosition: 'right -272px',
        cursor: 'pointer',
        border: '1px solid #cbcbcb',
        borderRadius: '5px 5px 5px 5px',
        outline: 'none',
        borderTop:'none',
        borderRight:'none',
        borderLeft: 'none'

    }
}
